import React from "react";
import {Link, useLocation} from "react-router-dom";
import { useEffect, useState } from "react";
import {ListPeople }from "../components/ListPeople";

import Navbar from "../components/Navbar";



export const Projects = (props) => {



    const location = useLocation();
    const state = location.state;
    let [projects, setProjects] = useState([]);

    
    
    useEffect(() => {
        getProjects();
    }, []);

    let getProjects = async () => {
        let response = await fetch('/api/projects/'+state.id+'/members/');
        let data = await response.json();
        console.log("Data:", data);
        setProjects(data);
    };

    const passing_data = {
        name: state.name,
        id: state.id,
        description: state.description,
        i_budget: state.initial_budget,
        c_budget: state.current_budget,
        i_deadline: state.initial_deadline,
        c_deadline: state.current_deadline,
        methodology: state.methodology,
      };



    const [clientName, setName] = useState('');
    const [releaseDate, setDate] = useState();
    const [methodology, setMethodology] = '';
    const requirements = 0;
    const design = 0;
    const implementation = 0;
    const unittesting = 0;
    const integration = 0;
    const riskScore = 0;

    
    return (
        <>
        <Navbar/>
        <div className="home-page">
            <div className="project-info-container">
                <div className="project-name">
                    <h1>{state.name}</h1>
                </div>
                <div className="project-description">
                    <h3 className="des-title"> Project Description: </h3>
                    <p className="des">{state.description}</p>
                    <p> Remaining budget: </p>
                </div>

                <button>Pause project</button>
                <button>Push back project</button>
            </div>  
            <div className="risk-info-container">
                <div className="project-risk-score">
                    <p> Risk Score: {riskScore}% Success Chance</p>
                </div>
            </div>
        </div>
        </>     
    );

      
    //     <div> 

    //         <h2> 
    //             This is the projects page for {state.name}!
    //         </h2>

    //         <h3>
    //             <Link to="/people" state={passing_data}>
    //                 People
    //             </Link>
    //         </h3>
                

    //     </div>
    // )
}
